export default function Login() {
    return <form className="flex flex-col justify-center items-center max-w-sm">
        <h1 className="px-5 py-3 text-lg text-black font-medium text-center">Login</h1>
        <input type="text" className="bg-transparent px-5 py-3 w-full rounded-3xl outline-none text-base text-black font-normal" name="email" />
        <label className="ml-5 absolute top-0 left-0 items-center text-neutral-500 font-normal py-3 px-4 " htmlFor="email">Correo</label>
        <input type="password" className="bg-transparent px-5 py-3 w-full rounded-3xl outline-none text-base text-black font-normal" name="password" />
        <label htmlFor="password">Contraseña</label>
        <button className="bg-gradient-to-r from-red-600 to-red-700 hover:from-red-700 hover:to-red-800 rounded-3xl px-5 py-3 w-full text-base text-white font-medium">Iniciar Sesión</button>
    </form>;
}
